'''Brambickle''' is a [[gnomish]] explorer located atop the [[Trollweiss Mountain]]. He may ask for a hard order in the [[Gnome Restaurant]] [[minigame]]. To get to Brambickle you '''do not''' need to have completed [[Troll Romance]]. Many players find it tedious to deliver to him, so most usually refuse to take the order, and wait five minutes for another one.

To find Brambickle, teleport to [[Trollheim]] and head towards the north-west path towards the [[Ice Path]] and [[Ice Gate]]. Be careful not to head west towards [[Troll Stronghold (location)|Troll Stronghold]] or north to the [[thrower troll]]s and [[God Wars Dungeon]]. Upon reaching the [[Ice Gate]], head north-west through the snow and enter the cave. DO NOT GO THROUGH THE ICE GATE. Turn on [[Protect from Melee]] to avoid damage from the [[Ice troll]]s or bring food if you cannot and are low level. Follow the cave north and exit through the crevasse in the most north-western area on the northern wall. Brambickle is on the plateau just south of the cave exit.

